-- ----------------------------
--  Table structure for `dp_cms_item`
-- ----------------------------
DROP TABLE IF EXISTS `dp_cms_item`;
CREATE TABLE `dp_cms_item` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'item_id',
  `cate_id` int(10) unsigned NOT NULL COMMENT '类目ID',
  `title` varchar(90) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '产品全称',
  `rate` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '预期年化收益率',
  `issuer` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '发行机构',
  `term` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '投资期限',
  `interest` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '付息方式',
  `riseamount` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '起投金额',
  `scale` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '募集规模',
  `direction` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '投资方向',
  `recruitment` tinyint(1) DEFAULT '0' COMMENT '募集状态0-在售，1-售罄，2-停售',
  `site` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '项目所在地',
  `income` text COMMENT '收益详情说明',
  `collect` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '募集账户',
  `capital` text COMMENT '资金投向',
  `payment` text COMMENT '还款来源',
  `measures` text COMMENT '风控措施',
  `other` text COMMENT '其他说明',
  `issuerintr` text COMMENT '发行机构说明',
  `subscription` text COMMENT '认购流程',
  `status` tinyint(1) DEFAULT '0',
  `sub_title` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='产品表';

-- ----------------------------
