BEGIN;
INSERT INTO `dp_cms_item` VALUES ('1', '8', '光大信托·弘远20号', '9.00%', 'XX信托', '24月	', '半年付息', '100万', '4.5亿', '基础设施', '0', '其他', '100万-300万  8.7%/年\r\n\r\n300万及以上  9.0%/年\r\n半年付息', '--', '用于补充企业流动资金。', '第一还款来源：融资方经营性收入；\r\n第二还款来源：担保方经营性收入。', '1.保证担保\r\n  毕节市开源建投投资（集团）有限公司提供连带责任保证担保。', '<p>交易结构</p><p><img alt=\"\" src=\"https://www.touzi.com/public/upload/ueditor/images/201801221516609344_20180122030113150.png\"></p><p>&nbsp;</p><p><strong>融资方—毕节市碧海新区建设投资有限责任公司（AA发债主体）</strong><strong>1.基本情况</strong>&nbsp; &nbsp;<strong>毕节市碧海新区建设投资有限责任公司</strong>成立于2010年12月，注册资本1亿元，公司唯一股东为毕节市七星关区人民政府。公司经营范围：碧海新区基础设施、公益设施、环保项目的投资、建设、运营及管理；旅游项目的投资；土地一级开发；房地产开发与经营；工程招投标；工程设计信息咨询；建筑材料（不含木材）销售；大健康养老项目的投资、建设；医疗卫生项目投资、建设、管理；工程项目管理。&nbsp; &nbsp;碧海建投分别于2015年和2016年非公开发行多期公司债券，根据最新出具的跟踪评级报告，<strong>碧海建投主体信用等级为AA级</strong>，评级展望为稳定。<strong>2.财务状况</strong>&nbsp; &nbsp;截至2016年末，碧海建投资产总额为<strong>95.87亿</strong>元，总负债为46.97亿元，资产负债率为49.00%。2016年公司实现营业收入20.27亿元，净利润为3.30亿元。</p><p>&nbsp;</p><p><strong>担保方—毕节市开源建投投资（集团）有限公司（主体和债券信用等级均为AA）</strong><strong>1.基本情况</strong>&nbsp; &nbsp;<strong>毕节市开源建设投资（集团）有限公司</strong>于2009年6月14日成立，公司股东和实际控制人为毕节市人民政府，公司实收注册资本30000万元，持股比例100%；截至2016年底，公司新增纳入合并范围子公司3家，为毕节市天和物业管理有限公司，贵州金惠电力销售有限公司和贵州致福光谷投资管理有限公司，子公司合计12家。<strong>2.财务状况</strong>&nbsp; &nbsp;2014年-2017年6月30日总资产为<strong>196.80亿</strong>元、<strong>281.14亿</strong>元、<strong>371.38亿</strong>元、<strong>385.33亿</strong>元，总负债分别是7.46亿元、147.39亿元、191.20亿元、205.25亿元，故资产负债率为3.79%、52.42%、51.48%、53.27%，从资产负债率来看开源建投偿债能力相对稳定。&nbsp; &nbsp;公司发行114毕节开源债/PR毕开源和16毕节开源小微债，经联合资信评估有限公司于2017年6月26日出具了上述两只债券的跟踪评级报告，<strong>评定主体和债券信用等级均为AA</strong>，评级展望稳定。</p><p>&nbsp;</p><p><strong>区域介绍—毕节市</strong><strong>1.基本情况</strong>&nbsp; &nbsp;<strong>毕节市</strong>于2011年12月27日撤销毕节地区设立地级毕节市，同年撤销县级毕节市成立七星关区。2015年，全市辖七星关、大方、黔西、金沙、织金、纳雍、威宁、赫章、百里杜鹃风景名胜区、金海湖新区。初步核算，2017年前三季度全市地区生产总值1271.5亿元，比上年同期增长11.6%。从三次产业来看，第一产业增加值258.86亿元，比上年同期增长6.6%；第二产业增加值499.9亿元，比上年同期增长10.6%；第三产业增加值512.7亿元，比上年同期增长15.2%。三次产业结构比为20.4：39.3：40.3。<strong>2.财务状况</strong>&nbsp; &nbsp;2016年全市全口径一般公共预算收入完成112.63亿元，为预算的95.12%，为上年同期的104.66%。一般公共预算收入中，税收收入完成83.9亿元，比上年增加4.7亿元，增长5.9%，为预算的95.9%。全市一般公共财政预算支出完成451亿元，比上年决算数409.7亿元增加41.3亿元，增长10.1%<br></p><p><br></p>', '---', '<ul><li>1.在线预约对感兴趣的产品，您可以在线预约或致电中投服务热线40000-91888。我们的理财经理会为您详细介绍产品情况。</li><li>2.准备认购您决定购买产品后，理财经理会与您核实具体打款日期和认购金额，然后帮助您预留产品额度。</li><li>3.认购产品通过银行转账或者汇款的形式，将资金转入产品的募集专户。</li><li>4.签订合同经核实认购款到账后，您即可以委托人的身份与发行机构签订正式合同。核实认购款是否到账，委托人须提供以下材料：① 银行转账或汇款凭证原件。② 打款账户。③ 身份证明文件。</li><li>5.确认函通过银行转账或者汇款的形式，将资金转入产品的募集专户。</li><li>6.售后跟踪通过银行转账或者汇款的形式，将资金转入产品的募集专户。</li></ul><p><br></p>', '0', '光大信托·弘远');
COMMIT;

