BEGIN;
INSERT INTO `dp_cms_page` VALUES ('1', '公司简介', '<p>中投在线股份有限公司（touzi.com），公司注册资本2亿元人民币，是国内领先的财富管理服务平台。依托互联网，中投在线立足于为高净值客户提供持续稳健的财富增长咨询服务，通过深入了解客户需求，协助规划财富目标、制定财富策略。发展至今，公司业务已遍布全国多地，受到众多投资者认可。</p>\r\n\r\n<p>平台通过为用户提供产品信息、在线咨询、投资研究以及增值服务，实现了金融产品 “Online-Offline”的联合互动，产品线覆盖私募股权、阳光私募、信托资管等多渠道；从产品筛选到投后跟踪服务，建立了完善的风控体系 。中投在线将在未来的发展中力争行业龙头，联动上游金融机构，覆盖全系金融产品，以创新共赢为核心，构筑互联网财富管理咨询服务中，独一无二的“开放式金融生态圈”。</p>\r\n', '公司简介', '平台通过为用户提供产品信息、在线咨询、投资研究以及增值服务，实现了金融产品 “Online-Offline”的联合互动，产品线覆盖私募股权、阳光私募、信托资管等多渠道；从产品筛选到投后跟踪服务，建立了完善的风控体系 。中投在线将在未来的发展中力争行业龙头，联动上游金融机构，覆盖全系金融产品，以创新共赢为核心，构筑互联网财富管理咨询服务中，独一无二的“开放式金融生态圈”。', '', '6', '0', '1516505564', '1543365575', '1', '3', '0', '0', '0', '0', null, 'uploads/images/20180322/1fca6caded4d91292d98916d0fa71749.jpeg', '1'), ('2', '组织架构', '<p>组织架构</p>\r\n', '组织架构', '组织架构', '', '0', '0', '1516505644', '1516505644', '1', '0', '7', '0', null, '1', '周工', null, '0'), ('3', '企业文化', '<p>企业文化</p>\r\n', '企业文化', '企业文化', '', '0', '0', '1516505674', '1516505674', '1', '0', '9', '0', null, '0', null, null, '0'), ('4', '合作伙伴', '<p>合作伙伴</p>\r\n', '合作伙伴', '合作伙伴', '', '0', '0', '1516505699', '1516505699', '1', '0', '9', '0', null, '0', null, null, '0'), ('5', '联系我们', '<p>联系我们</p>\r\n', '联系我们', '联系我们', '', '0', '0', '1516505720', '1516505720', '1', '0', '9', '0', null, '0', null, null, '0'), ('6', '324', '<p>枯</p>\r\n', '', '324', 'd', '8', '0', '1528360836', '1528360836', '1', '0', '0', '0', '0', '0', null, null, '0');
