DROP TABLE IF EXISTS `dp_deposit_set`;
CREATE TABLE `dp_deposit_set` (
  `onlinestage` varchar(16) NOT NULL DEFAULT '' COMMENT '网络平台',
  `onlineshop` varchar(16) NOT NULL DEFAULT '' COMMENT '网络机构',
  `onlinecounsoller` varchar(16) NOT NULL DEFAULT '' COMMENT '网络咨询师',
  `offlinestage` varchar(16) NOT NULL DEFAULT '' COMMENT '地面平台',
  `offlineshop` varchar(16) NOT NULL DEFAULT '' COMMENT '地面机构',
  `offlinecounsoller` varchar(16) NOT NULL DEFAULT '' COMMENT '地面咨询师',
  `clacstage` varchar(16) NOT NULL DEFAULT '' COMMENT '课程活动平台',
  `clacshop` varchar(16) NOT NULL DEFAULT '' COMMENT '课程活动机构',
  `claccounsoller` varchar(16) NOT NULL DEFAULT '' COMMENT '课程活动咨询师',
  `cladmin` varchar(16) NOT NULL DEFAULT '' COMMENT '课程活动管理员',
  `clactutor` varchar(16) NOT NULL DEFAULT '' COMMENT '课程活动输导员',
  `clactearch` varchar(16) NOT NULL DEFAULT '' COMMENT '课程活动上课老师',
  `id` int(11) NOT NULL AUTO_INCREMENT,
