-- ----------------------------
--  Table structure for `dp_member`
-- ----------------------------
DROP TABLE IF EXISTS `dp_member`;
CREATE TABLE `dp_member` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(32) NOT NULL DEFAULT '' COMMENT '用户名',
  `nickname` varchar(32) NOT NULL DEFAULT '' COMMENT '昵称',
  `password` varchar(96) NOT NULL DEFAULT '' COMMENT '密码',
  `mobile` varchar(11) NOT NULL DEFAULT '' COMMENT '手机号码',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '状态：0禁用，1启用',
  `create_time` int(11) DEFAULT NULL,
  `type` tinyint(1) DEFAULT '0' COMMENT '0普通 1 咨询师',
  `shopid` int(10) DEFAULT '0' COMMENT '分机构id',
  `email` varchar(100) DEFAULT NULL COMMENT 'email',
  `mobile_status` tinyint(1) DEFAULT '0' COMMENT '0未验证 1验证',
  `recommond` tinyint(1) DEFAULT '0' COMMENT '0不推荐 1推荐',
  `avar` varchar(250) DEFAULT NULL COMMENT '头像',
  `weixin` varchar(100) DEFAULT NULL,
  `qq` varchar(100) DEFAULT NULL,
  `alipay` varchar(100) DEFAULT NULL,
  `identifi` varchar(100) DEFAULT NULL,
  `cerfornt` varchar(200) DEFAULT NULL,
  `cerback` varchar(200) DEFAULT NULL,
  `preference` varchar(255) DEFAULT NULL COMMENT '偏好设置',
  `birthday` int(11) DEFAULT NULL COMMENT '生日',
  `sex` tinyint(1) DEFAULT NULL COMMENT '1男0女',
  `edu` varchar(20) DEFAULT NULL COMMENT '教育',
  `grade` varchar(20) DEFAULT NULL COMMENT '年级',
  `marital` tinyint(1) DEFAULT NULL COMMENT '0未1是',
  `profession` varchar(20) DEFAULT NULL COMMENT '职业',
  `province` varchar(20) DEFAULT NULL COMMENT '省',
  `city` varchar(20) DEFAULT NULL COMMENT '市',
  `tel` varchar(20) DEFAULT NULL COMMENT '电话',
  `isconsolle` tinyint(1) DEFAULT NULL COMMENT '0否1是',
  `consolletime` int(11) DEFAULT NULL COMMENT '咨询时间',
  `truename` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `sort` int(11) DEFAULT '0' COMMENT '排序越小越前',
  `is_diamonds` tinyint(1) DEFAULT '0' COMMENT '0 普通 会员 1心窝会员',
  `source_from` tinyint(1) DEFAULT '0' COMMENT '0 app 1h5',
  `sources` int(11) DEFAULT '8' COMMENT '默认平均分8分',
  `ondatenum` int(10) DEFAULT '0' COMMENT '咨询次数',
  `slogan` varchar(250) DEFAULT NULL COMMENT '标语',
  `shopids` varchar(100) DEFAULT NULL COMMENT '挂靠的分中心',
  `openshop` varchar(250) DEFAULT NULL COMMENT '偏好设置咨询地点',
  `vipday` int(10) DEFAULT '0' COMMENT '12 个月 年度会员 1 周会员',
  `viptime` int(11) DEFAULT NULL COMMENT '会员开始时间',
  `openchart` varchar(200) DEFAULT NULL COMMENT '开放咨询方式',
  `online` tinyint(4) DEFAULT '1' COMMENT '1 在线 0 下线',
  `viplastt` int(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='会员表';

