-- ----------------------------
--  Table structure for `dp_member_counsellor`
-- ----------------------------
DROP TABLE IF EXISTS `dp_member_counsellor`;
CREATE TABLE `dp_member_counsellor` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `tags` varchar(200) NOT NULL DEFAULT '' COMMENT '标签',
  `intro` varchar(250) NOT NULL DEFAULT '' COMMENT '简介',
  `memberid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '咨询师id',
  `remark` varchar(500) DEFAULT NULL COMMENT '祥细说明',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  `employment` int(11) DEFAULT NULL COMMENT '从业时间',
  `per` varchar(50) DEFAULT '30' COMMENT '默认30分钟每次 ',
  `wordchart` varchar(100) DEFAULT '250' COMMENT '文字聊天 每次100元',
  `iswordchart` tinyint(1) DEFAULT '1' COMMENT '0 不提供 1提供 默认提供',
  `speechchart` varchar(100) DEFAULT '250' COMMENT '语音聊天 每次200',
  `isspeechchart` tinyint(1) DEFAULT '1' COMMENT '0 不提供 1提供 默认提供',
  `videochart` varchar(100) DEFAULT '800' COMMENT '视频聊天 每次300',
  `facechart` varchar(100) DEFAULT '800' COMMENT '面对面 每次500',
  `isvideochart` tinyint(1) DEFAULT '1' COMMENT '0 不提供 1提供 默认提供',
  `isfacechart` tinyint(1) DEFAULT '1' COMMENT '0 不提供 1提供 默认提供',
  `online` tinyint(1) DEFAULT '0' COMMENT '0 为不在线 1 为在线',
  `diploma` varchar(200) DEFAULT NULL COMMENT '咨询师证书',
  `tearch` tinyint(1) DEFAULT '1' COMMENT '是否是讲师 0否1 是',
  `leader` tinyint(1) DEFAULT '1' COMMENT '是否是团队Leader 0否1是',
  `no` bigint(20) DEFAULT NULL COMMENT '编号',
  `wordchartlv` varchar(50) DEFAULT '0',
  `speechchartlv` varchar(50) DEFAULT '0',
  `videochartlv` varchar(50) DEFAULT '500',
  `facechartlv` varchar(50) DEFAULT '500',
  `ondatenum` int(10) DEFAULT '0' COMMENT '咨询次数',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='咨询师扩展表';

-- ----------------------------
--  Records of `dp_member_counsellor`
-- ----------------------------
BEGIN;
INSERT INTO `dp_member_counsellor` VALUES ('1', '7', '132', '2', '<p>国家二级心理咨询师\r\n昆山心理咨询师协会会员\r\n苏州某心理机构签约咨询师\r\n\r\n温和耐心、善于倾听、思维敏捷。世界500强外资企业有15年的项目管理经验，善于团队协作、与人沟通、找出事情的关键点。\r\n\r\n人生中需要坚强，但并不一定要一个人强撑，遇到困难的时侯，你需要一个人能听懂你的话，和你一起看清楚，到底发生了什么，发现在你内心深处的资源和力量，与你一起想办法，我愿意陪你共同渡过这段艰难的时刻。\r\n\r\n\r\n专业培训经历：\r\n2013年 国家二级心理咨询师&nbsp;\r\n2014年 胡凛老师《精神动力实务督导班》\r\n2015年 朱晓平老师 《心理咨询实操班》\r\n2016年 樊良永老师 《心理咨询技术强化班》\r\n2016年 杨凤池《分析体验式心理咨询技术》\r\n2016年 杨杰老师 《好父母的六重修炼》\r\n2017年 少儿心理咨询师\r\n2017年 国家二级心理咨询师证书（上海）\r\n2017年 正面管教系列课程&nbsp;\r\n\r\n擅长领域：\r\n【亲子教育】家庭教育，育儿教育，少儿心理，亲子沟通指导，敏感自卑，注意力不集中，学习困难，同学交往，早恋，代沟，入园焦虑，考试焦虑，单亲家庭，二胎', '1', '1521129600', '30', '150', '1', '200', '1', '300', '500', '1', '1', '1', '3', '1', '0', null, null, null, null, null, '2'), ('2', '7,9', 'sd', '3', '<p>23</p><audio controls=\"controls\" style=\"display: none;\"></audio>', '1', '1167408000', '21', '100', '1', '200', '1', '300', '500', '1', '1', '0', null, '0', '0', null, null, null, null, null, '0'), ('3', '7,9', 'ew', '6', '<p>sd</p>', '0', '1529164800', '0', '100', '1', '200', '1', '300', '400', '1', '1', '1', '', '1', '1', null, '90', '190', '290', '390', '0');
