  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `behavior_type` varchar(8) NOT NULL DEFAULT '0' COMMENT '行为类型',
  `behavior` varchar(250) NOT NULL DEFAULT '' COMMENT '行为描述',
  `memberid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '会员id',
