-- ----------------------------
--  Table structure for `dp_msg`
-- ----------------------------
DROP TABLE IF EXISTS `dp_msg`;
CREATE TABLE `dp_msg` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(164) NOT NULL DEFAULT '' COMMENT '标题',
  `descrption` varchar(250) NOT NULL DEFAULT '' COMMENT '描述',
  `sendid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '发起人',
  `reciveid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '接收人',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  `type` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '消息类型 0系统 1 订单',
  `display` varchar(200) DEFAULT NULL,
  `is_send` tinyint(1) DEFAULT '0' COMMENT '0未发送 1 已发送',
  `is_pay` tinyint(1) DEFAULT '0' COMMENT '0 未支付 1支付',
  `tid` int(10) DEFAULT NULL COMMENT '订单号',
  `noticeid` int(10) DEFAULT NULL COMMENT '关联系统消息ID',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='消息表';

