-- ----------------------------
--  Table structure for `dp_shop_agency`
-- ----------------------------
DROP TABLE IF EXISTS `dp_shop_agency`;
CREATE TABLE `dp_shop_agency` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(164) NOT NULL DEFAULT '' COMMENT '分机构名',
  `description` varchar(250) NOT NULL DEFAULT '' COMMENT '描述',
  `adminid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '分机构管理员',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  `city` varchar(200) DEFAULT NULL,
  `lincence` varchar(200) DEFAULT NULL COMMENT '营业执照',
  `address` varchar(200) DEFAULT NULL,
  `manager` varchar(200) DEFAULT NULL COMMENT '负责人',
  `tel` varchar(200) DEFAULT NULL COMMENT '联系电话',
  `webchat` varchar(220) DEFAULT NULL,
  `aptiude` varchar(200) DEFAULT NULL COMMENT '资质',
  `longvity` varchar(200) DEFAULT NULL COMMENT '质历',
  `summary` varchar(200) DEFAULT NULL,
  `auth` tinyint(1) DEFAULT '0' COMMENT '未认证 1认证',
  `bail` varchar(200) DEFAULT NULL,
  `setup` int(11) DEFAULT NULL COMMENT '创办时间',
  `map_address` varchar(100) DEFAULT NULL COMMENT '地址',
  `map` varchar(100) DEFAULT NULL COMMENT '经纬度',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=43 DEFAULT CHARSET=utf8 COMMENT='分机构表';

