-- ----------------------------
--  Table structure for `dp_shop_category`
-- ----------------------------
DROP TABLE IF EXISTS `dp_shop_category`;
CREATE TABLE `dp_shop_category` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `pid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '父级id',
  `title` varchar(128) NOT NULL DEFAULT '' COMMENT '分类标题',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `sort` int(11) NOT NULL DEFAULT '100' COMMENT '排序',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='咨询分类表';

-- ----------------------------
--  Table structure for `dp_shop_classes_allot`
-- ----------------------------
DROP TABLE IF EXISTS `dp_shop_classes_allot`;
CREATE TABLE `dp_shop_classes_allot` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `adminid` varchar(100) NOT NULL DEFAULT '0' COMMENT '管理员',
  `tearchid` varchar(100) NOT NULL DEFAULT '0' COMMENT '讲师员',
  `coachid` varchar(100) NOT NULL DEFAULT '0' COMMENT '辅导员',
  `ascale` varchar(120) DEFAULT '0.0' COMMENT '管理员分配比例',
  `tscale` varchar(120) DEFAULT '0.0' COMMENT '讲师员分配比例',
  `cscale` varchar(120) DEFAULT '0.0' COMMENT '辅导员分配比例',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  `classid` int(10) DEFAULT NULL COMMENT '课程id',
  `shopid` int(10) DEFAULT NULL COMMENT '分中心ID',
  `sscale` varchar(120) DEFAULT NULL COMMENT '分中心比例',
  `mscale` varchar(255) DEFAULT NULL COMMENT '平台分配比例',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='课程分配表';

