DROP TABLE IF EXISTS `dp_trade`;
CREATE TABLE `dp_trade` (
  `tid` varchar(200) NOT NULL,
  `shopid` int(10) unsigned NOT NULL COMMENT '订单所属的机构id',
  `memberid` int(10) unsigned NOT NULL COMMENT '会员id',
  `mid` int(10) unsigned NOT NULL COMMENT '咨询师id',
  `classid` int(10) unsigned NOT NULL COMMENT '课程id',
  `status` varchar(24) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT '订单状态 0 待支付 1已支付 2取消 3冻结',
  `payment` decimal(20,3) DEFAULT '0.000' COMMENT '实付金额',
  `created_time` int(10) unsigned DEFAULT NULL COMMENT '订单创建时间',
