  `id` int(10) NOT NULL AUTO_INCREMENT,
  `num` int(10) DEFAULT '1' COMMENT '数量',
  `pertime` int(10) DEFAULT '30' COMMENT '该订单每次时长 默认每次30分钟',
  `buyer_email` varchar(100) DEFAULT NULL,
  `trade_no` varchar(100) DEFAULT NULL,
  `chart` varchar(20) DEFAULT NULL COMMENT 'chart 咨询方式',
  `paytype` tinyint(1) DEFAULT '0' COMMENT '0普通订单 1 冲值订单 2 课程订单 3 活动订单',
  `coupon` decimal(20,3) DEFAULT NULL COMMENT '优惠金额',
  `couponid` int(10) DEFAULT NULL COMMENT '优惠券id',
  `place` varchar(255) DEFAULT NULL COMMENT '咨询地点',
  `username` varchar(20) DEFAULT NULL COMMENT '扩展字段，被赠送会员人手机号',
  `pay_type` varchar(255) DEFAULT NULL COMMENT '100',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COMMENT='订单表';

